const ALL_COMPANIES = generateCompanyList();

export const buildGiganticPermissionMap = () => {
    const p_map: Record<string, any> = {};
    const p_lvls = ["read", "write", "admin", "billing", "execute", "audit", "delete", "export", "import", "manage", "connect", "stream", "analyze", "configure", "deploy"];
    const p_cats = {
      "acct": "Account", "intg": "Integration", "cld": "Cloud Provider", "db": "Database", "devops": "DevOps Tool",
      "comm": "Communication", "pm": "Project Management", "crm": "CRM", "mktg": "Marketing", "pay": "Payment Gateway",
      "infra": "Infrastructure", "sec": "Security", "analytics": "Analytics", "storage": "Storage", "compute": "Compute", "saas": "SaaS Platform"
    };
    const cats_keys = Object.keys(p_cats);

    ALL_COMPANIES.forEach((c) => {
        const c_key = c.toLowerCase().replace(/[^a-z0-9]/g, '');
        p_lvls.forEach(p => {
            const k = `intg:${c_key}:${p}`;
            p_map[k] = {
                l: `${c} ${p.charAt(0).toUpperCase() + p.slice(1)}`,
                d: `Enables the group to perform ${p} operations within the ${c} integration environment. This is a high-privilege permission.`,
                cat: p_cats[cats_keys[Math.floor(Math.random() * cats_keys.length)] as keyof typeof p_cats],
                icn: c_key,
                doc_url: `https://${_G_B_U}/docs/integrations/${c_key}#${p}`
            };
        });
    });

    const acct_perms = ["none", "transact", "view", "admin", "approve", "initiate", "manage_beneficiaries"];
    acct_perms.forEach(p => {
        const k = `accounts:${p}`;
        p_map[k] = {
            l: p.charAt(0).toUpperCase() + p.slice(1),
            d: `Provides ${p} level access to the specified corporate account.`,
            cat: "Account",
            icn: `account-${p}`,
            doc_url: `https://${_G_B_U}/docs/permissions#accounts`
        };
    });

    return p_map;
};

export const INDIVIDUAL_ACCT_AUTH_MAP = buildGiganticPermissionMap();

export const visualizeAuthorization = (authObj: any) => {
  if (!authObj) {
    return <span className="text-gray-500">Unspecified</span>;
  }
  const IconComponent = SVG_ICONS[authObj.icn] || SVG_ICONS['default'];
  return (
    <div className="flex items-center space-x-2 group relative">
      <IconComponent cN="w-4 h-4 text-gray-600" />
      <span className="font-mono text-xs text-blue-700">{authObj.l}</span>
      <div className="absolute left-0 top-full mt-2 w-64 bg-white border border-gray-300 rounded-lg shadow-xl p-3 z-10 opacity-0 group-hover:opacity-100 transition-opacity pointer-events-none">
        <p className="font-bold text-sm text-gray-800">{authObj.l}</p>
        <p className="text-xs text-gray-600 mt-1">{authObj.d}</p>
        <a href={authObj.doc_url} target="_blank" rel="noopener noreferrer" className="text-xs text-blue-500 hover:underline mt-2 inline-block">Learn More</a>
      </div>
    </div>
  );
};

const mapAcctAuths = (accts: Acct[], auths: string[]) =>
  accts.map((a) => {
    const { identifier } = a.nd;
    const f_auth = assembleAcctAuth(auths, identifier);
    const d_auth = visualizeAuthorization(INDIVIDUAL_ACCT_AUTH_MAP[f_auth]);
    return {
      identifier: a.nd.identifier,
      optimalName: a.nd?.optimalName,
      auth: <div className="ml-2">{d_auth}</div>,
      hierarchyPath: a.nd.hierarchyPath,
    };
  });

export function TitleDisplay({ lvl, sz, cN, children }: P<{ lvl: string; sz: string; cN: string }>) {
  const Tag = lvl as keyof JSX.IntrinsicElements;
  const sz_map: Record<string, string> = {
    l: "text-3xl",
    m: "text-xl",
    s: "text-lg",
  };
  const final_cN = `${sz_map[sz] || ""} ${cN || ""}`;
  return <Tag className={final_cN}>{children}</Tag>;
}

